(255, 'monsterinsights_notifications', 'a:4:{s:6:\"update\";i:1659594204;s:4:\"feed\";a:0:{}s:6:\"events\";a:7:{i:0;a:10:{s:2:\"id\";s:62:\"monsterinsights_notification_to_setup_affiliate_links_20220801\";s:4:\"icon\";s:7:\"default\";s:5:\"title\";s:30:\"Set Up Affiliate Link Tracking\";s:7:\"content\";s:556:\"By tracking your affiliate links in Google Analytics, you can gather all the data you need to optimize your links for maximizing affiliate revenue. You can track affiliate link clicks on your website with little configuration needed.<br><br><a href=\"https://www.monsterinsights.com/how-to-set-up-affiliate-link-tracking-in-wordpress/?utm_source=liteplugin&utm_medium=monsterinsights-notifications-sidebar&utm_campaign=notifications&utm_content=8.7.0\" target=\"_blank\">In this article</a>, well show you how to set up affiliate link tracking in WordPress.\";s:4:\"type\";a:5:{i:0;s:5:\"basic\";i:1;s:4:\"lite\";i:2;s:6:\"master\";i:3;s:4:\"plus\";i:4;s:3:\"pro\";}s:4:\"btns\";a:1:{s:9:\"read_more\";a:3:{s:3:\"url\";s:199:\"https://www.monsterinsights.com/how-to-set-up-affiliate-link-tracking-in-wordpress/?utm_source=liteplugin&utm_medium=monsterinsights-notifications-sidebar&utm_campaign=notifications&utm_content=8.7.0\";s:4:\"text\";s:9:\"Read More\";s:11:\"is_external\";b:1;}}s:5:\"start\";s:18:\"08/01/2022 1:15 am\";s:3:\"end\";s:10:\"08/24/2022\";s:8:\"category\";s:7:\"insight\";s:8:\"priority\";i:2;}i:1;a:10:{s:2:\"id\";s:65:\"monsterinsights_notification_to_add_more_file_extensions_20220726\";s:4:\"icon\";s:7:\"default\";s:5:\"title\";s:28:\"Track Your Website Downloads\";s:7:\"content\";s:804:\"By default, MonsterInsights automatically tracks downloads of the following file extensions: doc, pdf, ppt, zip, xls, docx, pptx, and xlsx. You can easily add or remove extensions from that list in the <a href=\"https://contrau.ventures/wp-admin/admin.php?page=monsterinsights_settings&monsterinsights-scroll=monsterinsights-settings-block-file-downloads&monsterinsights-highlight=monsterinsights-settings-block-file-downloads#/engagement\">Engagement settings</a> of MonsterInsights.<br><br> You can view your Top Downloads report directly in the MonsterInsights <a href=\"https://contrau.ventures/wp-admin/admin.php?page=monsterinsights_reports&monsterinsights-scroll=monsterinsights-report-download-links&monsterinsights-highlight=monsterinsights-report-download-links#/publishers\">Publishers report</a>.\";s:4:\"type\";a:5:{i:0;s:5:\"basic\";i:1;s:4:\"lite\";i:2;s:6:\"master\";i:3;s:4:\"plus\";i:4;s:3:\"pro\";}s:4:\"btns\";a:1:{s:24:\"add_more_file_extensions\";a:2:{s:3:\"url\";s:226:\"https://contrau.ventures/wp-admin/admin.php?page=monsterinsights_settings&monsterinsights-scroll=monsterinsights-settings-block-file-downloads&monsterinsights-highlight=monsterinsights-settings-block-file-downloads#/engagement\";s:4:\"text\";s:19:\"Add File Extensions\";}}s:5:\"start\";s:18:\"07/26/2022 1:43 am\";s:3:\"end\";s:10:\"08/13/2022\";s:8:\"category\";s:7:\"insight\";s:8:\"priority\";i:2;}i:2;a:10:{s:2:\"id\";s:51:\"monsterinsights_notification_mobile_device_20220721\";s:4:\"icon\";s:7:\"default\";s:5:\"title\";s:30:\"Traffic From Mobile Devices 0%\";s:7:\"content\";s:525:\"Traffic from mobile devices is considerably lower on your site compared to desktop devices. This could be an indicator that your site is not optimised for mobile devices.<br><br>Take a look now at <a href=\"https://www.wpbeginner.com/beginners-guide/how-to-preview-the-mobile-layout-of-your-site/?utm_source=monsterinsights&utm_medium=monsterinsights-notifications-sidebar&utm_campaign=notifications&utm_content=8.7.0\" target=\"_blank\">how your site looks</a> on mobile and make sure all your content can be accessed correctly.\";s:4:\"type\";a:5:{i:0;s:5:\"basic\";i:1;s:4:\"lite\";i:2;s:6:\"master\";i:3;s:4:\"plus\";i:4;s:3:\"pro\";}s:4:\"btns\";a:2:{s:11:\"view_report\";a:2:{s:3:\"url\";s:143:\"https://contrau.metacoders.dev/wp-admin/admin.php?page=monsterinsights_reports&monst