(1, 2, '_wp_page_template', 'default'),
(2, 3, '_wp_page_template', 'default'),
(3, 4, '_edit_last', '1'),
(4, 4, '_edit_lock', '1658828561:1'),
(5, 10, '_edit_last', '1'),
(6, 10, '_edit_lock', '1657174187:1'),
(7, 16, '_edit_last', '1'),
(8, 16, '_edit_lock', '1657085775:1'),
(11, 23, '_edit_lock', '1658828893:1'),
(12, 23, '_edit_last', '2'),
(13, 23, 'order', '1'),
(14, 23, '_order', 'field_62c4f32499e42'),
(15, 23, 'question', 'Why do you invest in early-stage startups?'),
(16, 23, '_question', 'field_62c4f33099e43'),
(17, 23, 'answer_part_1', 'We believe there is lost opportunity for the thousands of young startups who haven\'t yet scaled enough to access institutional capital. The critical milestones to receive traditional VC seed investment keep moving farther down the growth curve, leaving a gap in funding at the earliest stages where the greatest financial returns are made.'),
(18, 23, '_answer_part_1', 'field_62c4f35d99e44'),
(19, 23, 'answer_part_2', 'We set out to conserve the energy normally wasted in fundraising and channel it into growth, creating immediate value for both entrepreneurs and our investors.'),
(20, 23, '_answer_part_2', 'field_62c4f36499e45'),
(21, 23, 'answer_part_3', 'In short, we aim to provide early access to capital to help founders prove out a thesis, find early indications of product-market fit, and achieve important traction to secure the next round of funding.'),
(22, 23, '_answer_part_3', 'field_62c4f36d99e46'),
(23, 23, '_yoast_wpseo_estimated-reading-time-minutes', '0'),
(24, 23, '_yoast_wpseo_wordproof_timestamp', ''),
(25, 25, '_edit_lock', '1658828847:2'),
(26, 25, '_edit_last', '2'),
(27, 25, 'order', '2'),
(28, 25, '_order', 'field_62c4f32499e42'),
(29, 25, 'question', 'What do you look for in a potential investment?'),
(30, 25, '_question', 'field_62c4f33099e43'),
(31, 25, 'answer_part_1', 'Here\'s a glimpse into what excites us when we consider an investment: Large and growing market, preferably untapped, Impressive team of domain experts who are passionate about their mission and exhibit resilience and resourcefulness, Strong, defensible margins from recurring or predictable revenue, Customer acquisition advantages, Capital efficiency and scalability, Strong network effects and embedded virality, Multiple potential paths to exit'),
(32, 25, '_answer_part_1', 'field_62c4f35d99e44'),
(33, 25, 'answer_part_2', 'BONUS: Accelerating growth rates and engagement metrics'),
(34, 25, '_answer_part_2', 'field_62c4f36499e45'),
(35, 25, 'answer_part_3', ''),
(36, 25, '_answer_part_3', 'field_62c4f36d99e46'),
(37, 25, '_yoast_wpseo_estimated-reading-time-minutes', '0'),
(38, 25, '_yoast_wpseo_wordproof_timestamp', ''),
(39, 26, '_edit_lock', '1658828854:2'),
(40, 26, '_edit_last', '2'),
(41, 26, 'order', '3'),
(42, 26, '_order', 'field_62c4f32499e42'),
(43, 26, 'question', 'Which stage do you invest?'),
(44, 26, '_question', 'field_62c4f33099e43'),
(45, 26, 'answer_part_1', 'We invest in rounds that precede the Series A (Pre-Seed and Seed, effectively)'),
(46, 26, '_answer_part_1', 'field_62c4f35d99e44'),
(47, 26, 'answer_part_2', 'We rarely invest off a cocktail napkin unless we\'ve worked with the founder already, but we prefer to be the first institutional money in the door. We want to see a product and some early metrics pointing in the right direction.'),
(48, 26, '_answer_part_2', 'field_62c4f36499e45'),
(49, 26, 'answer_part_3', ''),
(50, 26, '_answer_part_3', 'field_62c4f36d99e46'),
(51, 26, '_yoast_wpseo_estimated-reading-time-minutes', '0'),
(52, 26, '_yoast_wpseo_wordproof_timestamp', ''),
(53, 27, '_edit_lock', '1658828884:2'),
(54, 27, '_edit_last', '2'),
(55, 27, 'order', '4'),
(56, 27, '_order', 'field_62c4f32499e42'),
(57, 27, 'question', 'Whats your investment process? And how long it will take?'),
(58, 27, '_question', 'field_62c4f33099e43'),
(59, 27, 'answer_part_1', 'We know raising a round is a pain, so we run a fast, low-friction, but disciplined investment process. And because we know what were looking for, we offer crisp execution from our initial investment to potential downstream rounds as your business grows. Please check in with other entrepreneurs weve backed. Youll find that weve never missed a round because we couldnt move fast enough.'),
(60, 27, '_answer_part_1', 'field_62c4f35d99e44'),
(61, 27, 'answer_part_2', ''),
(62, 27, '_answer_part_2', 'field_62c4f36499e45'),
(63, 27, 'answer_part_3', ''),
(64, 27, '_answer_part_3', 'field_62c4f36d99e46'),
