(986, 280, 'content_content_part_1_detail_content_image', '<div class=\"frameimg\">             <img src=\"https://contrau.metacoders.dev/wp-content/uploads/2022/07/imagearticle-1.png\" alt=\"\" />             <p>Co Founder and collaborator from bTaskee</p>         </div>'),
