(992, 280, 'content_content_part_2_detail_content', '<div class=\"framequestionmain\">       <div class=\"frametitle\">         <div class=\"detailtitle\">           BTaskee is currently the           <span class=\"detailtitlered\">first place</span>in Vietnam           to&nbsp;           <span class=\"detailtitlered\">grant a degree</span>&nbsp;           <span>             in housework to demonstrate their ability and attitude to work.           </span>         </div>       </div>       <div class=\"framequestiontitle\">         <div class=\"questiontitle\">           What is the application           <span class=\"redcontent\">idea for bTaskee?</span>         </div>         <div class=\"articlequestion\">           <p>             Oh, me? I started another business before bTaskee, but it didn\'t             work. Public. Then he realized that the economic potential in             Vietnam was great because he was a developing country. But the             gap between rich and rich.It was a matter of concern at that             time. Many people want to create applications and services for             financially wealthy people, but workers are always busy with             life.What about you? They don\'t have the right to choose what             they want.What, what do I do?           </p>           <div class=\"somecannot\">             Some cannot even afford to send their children to school,             especially single mothers. I want to help them realize the value             of what they are doing and the potential for career development.             That\'s the driving force behind his idea of starting a business.           </div>         </div>       </div>       <div class=\"framequestiontitle2\" >         <div class=\"questiontitle\">           You mentioned that you failed to start a business. After that,           <span class=\"redcontent\">What kind of fortune</span>&nbsp;did you bring back for your           next journey?         </div>         <div class=\"articlequestion\">           <p>             In 2006, he started writing software for Saas Base.ERVICE and             cloud computing help businesses manage data more securely,             cost-effective, but he realized at the time that productivity             was low.My m was so new, most small and medium-sized businesses             were not ready for SaaS at the time, and it took a lot of time             and resources to change consumer thinking because it was a             fairly new concept.However, thanks to this failure, I got the             time. You slowly look back on everything and realize that you             don\'t have to start with technology that\'s so new, there\'s             always some aspects that are already there, that if you apply             technology to that field, you can produce unexpected results.           </p>         </div>       </div>       <div class=\"frameimgarticle\">         <div class=\"frameimgarticle1\">           <img src\"https://contrau.metacoders.dev/wp-content/uploads/2022/07/imgarticle1.png\" alt=\"\" />         </div>         <div class=\"frameimgarticle2\">           <img src\"https://contrau.metacoders.dev/wp-content/uploads/2022/07/imgarticle2.png\" alt=\"\" />         </div>       </div>       <div class=\"framequestiontitle\">         <div class=\"questiontitle\">           What was the           <span class=\"redcontent\">&nbsp;hardest thing you had to go through&nbsp;</span>           when you chose to start a business?         </div>         <div class=\"articlequestion\">           <p>             I think it\'s faith. The first is my belief.i with the goal of             starting a business. Around the time I got home, I shared my             ideas with my middle and high school friends. Most people find             the project quite interesting and new, but 10 people would             probably advise him not to (smile) because it\'s hard to change             the way workers think and behave. However, you are quite a             patient person. I\'d like to get opinions from all sides.There             are more diverse views on one issue, but you will stick to your             decision until the end.            </p>           <p class=\"thesecond\">The second is his belief in the workers.           One sentence. If you don\'t trust them, who\'s going to do it? I           have to give them the feeling of listening, of being trusted, of           being respected.If anything happens, I\'m sure they\'ll trust me           and do their best for this job.</p>           <p> Photo: bTaskee participating in           Saigon Tech Startup Fest in 2016</p>         </div>       </div>     </div>'),
