(1066, 281, 'content_content_part_3_detail_content', '<div class=\"framequestionmain\">       <div class=\"frametitle\">         <div class=\"detailtitle\">           BTaskee is currently the           <span class=\"detailtitlered\">first place&nbsp;</span> in           Vietnam to&nbsp;           <span class=\"detailtitlered\">grant a degree</span>&nbsp;           <span>             in housework to demonstrate their ability and attitude to work.           </span>         </div>       </div>       <div class=\"framequestiontitle\">         <div class=\"questiontitle\">           What did you&nbsp;           <span class=\"redcontent\">get and lose&nbsp;</span>           when you chose to start a business?         </div>         <div class=\"articlequestion\">           <p>             I think I\'ll get more. You get to live and work in the United             States. My childhood passion is software technology. Above all,             you can create very meaningful values for the community. This             profession has helped many people earn better income to cover             their lives and gave them a different perspective on their             profession           </p>           <p class=\"manybee\">Many \"bee sisters\" who joined bTaskee no longer           watch help.Ha is another \"living profession\" that for them is           future career orientation and is really proud of it.</p>           <p class=\"detailarticle2\">             He is also happy that he can build a team with corporate             development mindset to improve the lives of others, not for             profit or sales. For him, it\'s always more fun to talk about his             inner comfort than how much money he earns. And of course, there             must be a trade-off for every decision. When you came back to             Vietnam at that time, you were quite worried about what your new             life would be like? You have to abandon all your habits, better             job opportunities in Canada, accept your safety and return.             However, if you send me back six years ago, I\'ll still choose to             start a business because I know what I need.           </p>         </div>       </div>       <div class=\"framequestiontitle\">         <div class=\"questiontitle\">           What made           <span class=\"redcontent\">bTaskee really different?</span>         </div>         <div class=\"articlequestion\">           <p>             First of all, it is the true value of bTaskee to customers and             collaborators. About 70 percent of users know and use the app             because of their acquaintances\' recommendations. The word of             mouth effect has helped us grow quite quickly in our worship, in             part confirming our customer\'s perception.Just now.           </p>           <p class=\"detailarticle2\">             For collaborators, bTaskee is a community of professional             helpers who are always willing to help each other, as well as             the highest income, most comfortable in terms of working hours.             Here, Ong sisters are communicated, shared and listened to to             grow together. There are a lot of functions and policies on the             app that are made through listening and understanding.This             tumor.           </p>         </div>       </div>        <div class=\"frameimgarticle\">         <div class=\"frameimgarticle3\">           <img src\"https://contrau.metacoders.dev/wp-content/uploads/2022/07/imgarticle3.png\" alt=\"\" />           <p> Ong sisters attending the gala bTaskee </p>         </div>       </div>       <div class=\"framequestiontitle\">         <div class=\"articlequestion\">           <p>             Sincerity is the second factor to tell the difference in             bTaskee. Quality of service, customer experience, and partner             income are indicators of best interest, not profitability.           </p>           <p>             Collaborators can count the amount of money customers have to             pay, the amount they receive per job, all detailed and             transparent. Each response on the application (from customers or             collaborators) is addressed by real-world action, such as             training programs from scratch.n to enhancements are digitized             to help collaborators learn directly from applications when they             have time. In addition, bTaskee always offers free advanced             training classes and is the first company to grant a degree for             housework. In addition, the company holds monthly awards, Golden             Ong, Silver Ong, and Top 100 awards every year, holding year-end             gala performances and efforts. Ong bTaskee\'s efforts to make it             more concrete.the perspective of a housekeeper.           </p>         </div>       </div>        <div class=\"frameimgarticle\">         <div class=\"frameimgarticle4\">           <img src\"https://contrau.metacoders.dev/wp-content/uploads/2022/07/imgarticle4.png\" alt=\"\" />           <p> Gala awards outstanding individuals.</p>         </div>       </div>     </div>'),
