(1172, 283, 'content_content_part_1_detail_content', '<div class=\"detailarticle\">\r\n    It was 11 a.m. at the beginning of the week. The waiters and waitresses of the spicy fish rice vermicelli with bamboo shoots restaurant named  Nht in Hanoi were busily cutting rice vermicelli and packing broth for dozens of servings.\r\n    <br/> <br/>\r\n    Tingting. The bill for an order of 5 special stir-fried beef rib rice vermicelli servings was just printed from POS. The waiter quickly shifted to pack mixed herbs and cooked beef for a shipper to take away. Whereas, in front of the opposite food stall, shippers were waiting in line for their customers orders to be prepared. The fried rice cooking mixer was then turned on, well mixing golden rice grains under stable heat. This national fried rice brand was going to witness a boom in the number of orders. \r\n    <br/> <br/>\r\n    Though these three restaurants are listed on different food delivery applications, they have the same location and are run by a single chef. Each just needs enough space for cooking because they sell food online, via food delivery applications.\r\n    <br/> <br/>\r\n    Today, we will meet Mr. Viet Le - Co-founder of the cloud kitchen model AirKitchen to have a better understanding of this concept as well as the story behind this interesting startup.\r\n</div>'),
