(1184, 283, 'content_content_part_2_detail_content', '<div class=\"framequestionmain\">\r\n    <div class=\"frametitle\"> \r\n        <div class=\"detailtitle\">\r\n            <span class=\"detailtitlered\">The tough problem</span> is how to have a business model with\r\n            <span class=\"detailtitlered\">scalability for future growth</span> and <span class=\"detailtitlered\">near-term profit potential.</span>\r\n        </div>\r\n    </div>\r\n\r\n    <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n        Hello, nice to meet you.  I wonder <span class=\"redcontent\">what brought</span> you and your teammates <span class=\"redcontent\">to the idea of building AirKitchen.</span> Could you please tell me a little bit about it?\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        In the course of looking for start-up ideas, I was completely captivated by the Cloud Kitchen business model of Travis Kalanick - Former CEO and Co-founder of billion-dollar startup Uber. That model was deployed in the US. My inspiration also came partially from Rebel Foods, an Indian chain of more than 3,000 online restaurants in 35 cities in the second most populous country on the planet. The cloud kitchen model had been blooming in Korea and the Philippines and capturing the attention of many large investment funds as well as the support of a plenty of customers. So, I thought of popularizing this model in Vietnam. I then looked for partners to build a specific plan and put it into practice. That was how AirKitchen was brought to life.\r\n    </div>\r\n    </div>\r\n\r\n<div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/08/1209394601649839623creative-2-copy.jpeg\" alt=\"\" />\r\n    </div>\r\n    <div class=\"frameimgarticle2\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/08/3988622361639978702single_brand_cloud_kitchen_desk.png\" alt=\"\" />\r\n    </div>\r\n</div>\r\n\r\n<div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/08/4873999401646215020creative-2.png\" alt=\"\" /> <p>Rebel Foods over the years.</p>\r\n    </div>\r\n    <div class=\"frameimgarticle2\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/08/7169578981639978598single_brand_QSR_desk.png\" alt=\"\" />\r\n    </div>\r\n</div>\r\n\r\n    <div class=\"framequestiontitle\" >\r\n    <div class=\"questiontitle\">\r\n        What\r\n        <span class=\"redcontent\">challenges</span> did you <span class=\"redcontent\">encounter</span> in the first days of <span class=\"redcontent\">your startup journey</span>?\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        The biggest difficulty for many startup-ers is how to persuade investors to disburse their funds. To this end, our business must hold an appeal to them. And AirKitchen is no exception.\r\n         </br></br>\r\n         The tough problem is how to have a business model with scalability for future growth and near-term profit potential. These are basic business criteria, but its very difficult for a startup to achieve both. We have to test our model over and over again to find answers to a series of difficult questions. How could AirKitchen be valued at half or one billion US dollars? Could the current model solve that problem? If not, how its transformation process should be? Could we turn our food serving system into a synchronous F&B platform in the future? We conducted research to resolve all of these concerns and put forward our solutions during 2021.\r\n    </div>\r\n    </div>\r\n\r\n    <div class=\"framequestiontitle2\" >\r\n    <div class=\"questiontitle\">\r\n        Could you reveal a bit about\r\n        <span class=\"redcontent\">your process of testing</span> the business model last year that you mentioned earlier?\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        In 2021, when the pandemic was spreading all over the place, AirKitchen came to the decision of joining hands with traditional restaurants in the form of a franchise partnership. AirKitchen has two assumptions to explain this choice.\r\n         </br></br>\r\n         First, such a partnership will help minimize costs for both sides. Traditional restaurants, with existing premises, are responsible for helping us distribute the dishes under our brand. Whereas, we provide them with everything, from ingredients to order management system. So, all that traditional restaurants have to do is to cook the given recipes. They receive a commission on every order in return. In so doing, we could save the costs of space, personnel, and utilities.\r\n         </br></br>\r\n         Secondly, franchising has been a great solution for us on the way to upgrading our system. It enables us to have small-scale selling locations at traditional restaurants, besides the main selling sites. Thereby, our network has been expanded massively, our brand awareness has been increased, and new B2B (business-to-business) opportunities have been opened up by selling ingredients and management software to traditional restaurants.\r\n         </br></br>\r\n         This is one of the most successful models the AirKitchen team figured out in the previous year.\r\n    </div>\r\n    </div>\r\n</div>'),
