(1194, 283, 'content_content_part_3_detail_content', '<div class=\"framequestionmain\">\r\n    <div class=\"frametitle\"> \r\n        <div class=\"detailtitle\">\r\n            <span class=\"detailtitlered\">The tough problem</span> is how to have a business model with\r\n            <span class=\"detailtitlered\">scalability for future growth</span> and <span class=\"detailtitlered\">near-term profit potential.</span>\r\n        </div>\r\n    </div>\r\n\r\n    <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n        In your opinion, what <span class=\"redcontent\"> separates AirKitchen</span> from <span class=\"redcontent\">its competitors</span> in the market today?\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        First, this is not a kitchen space rental model as mistakenly thought by many people. AirKitchen develops selling locations for its own products.\r\n        </br></br>\r\n        Whats more, AirKitchen offers a wide variety of dishes at each of its selling locations. This model has many advantages. Apart from saving much cost for space, utilities, personnel, etc., ingredients are utilized in the way of being used in different dishes. This helps lessen excess ingredients as well as input costs. For example, we can use grilled pork for two dishes: grilled pork and rice vermicelli, and grilled pork with steamed sticky rice.\r\n    </div>\r\n    </div>\r\n\r\n<div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/IMG_2673-copy-scaled.jpg\" alt=\"\" /> \r\n    </div>\r\n    <div class=\"frameimgarticle2\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/Modify-Color-Balance-Layer.jpg\" alt=\"\" />\r\n    </div>\r\n</div>\r\n\r\n<div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/08/IMG_2718-copy-scaled.jpg\" alt=\"\" /> <p>The main kitchen is preparing cooking ingredients.</p>\r\n    </div>\r\n    <div class=\"frameimgarticle2\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/08/IMG_2727-copy-scaled.jpg\" alt=\"\" />\r\n    </div>\r\n</div>\r\n\r\n    <div class=\"framequestiontitle\" >\r\n    <div class=\"questiontitle\">\r\n        What\r\n        <span class=\"redcontent\">core value</span> has your business been <span class=\"redcontent\">pursuing toward a thriving future</span> in the F&B industry?\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        Operational ability and product creativity are the two qualities weve been giving priority to since our entrance into this industry.\r\n         </br></br>\r\n         The first restaurant in a chain might be crowded, but the following ones in the chain might not be that liked by customers due to degradation in food quality, customer service, etc. Thats the reason why its necessary to ensure consistent operational capacity at all of the selling locations in the system.\r\n         </br></br>\r\n         The F&B industry changes very often to form new trends. For example, today, restaurant A offers strawberry pudding. But the next day, restaurant B offers another variation of the cake, giving it a more creative look and an interesting name. Many people must feel an urge to come to check in with the new cake and take some photos with it to post on their social sites. This explains the importance of creativity in this industry. We have no choice but to stay innovative in terms of products (offering creative seasonal products), upgrading dcor and ingredients, and enhancing flavors.\r\n    </div>\r\n    </div>\r\n\r\n<div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/08/Asset-30@4x.png\" alt=\"\" /> \r\n    </div>\r\n    <div class=\"frameimgarticle2\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/08/Ban-sao-cua-BunSuong_2.png\" alt=\"\" />\r\n    </div>\r\n</div>\r\n\r\n<div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/08/Com-tam-01.png\" alt=\"\" /> <p>The food brands under the management of Air Kitchen.</p>\r\n    </div>\r\n    <div class=\"frameimgarticle2\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/08/Xoi_Suon_Cay5.png\" alt=\"\" />\r\n    </div>\r\n</div>\r\n</div>'),
