(1203, 283, '_content_content_part_4_detail_title', 'field_62c653fad6c95'),
(1204, 283, 'content_content_part_4_detail_content', '<div class=\"framequestionmain\">\r\n    <div class=\"frametitle\"> \r\n        <div class=\"detailtitle\">\r\n            <span> A hero never stands alone.</span>\r\n            <span class=\"detailtitlered\">The secret to success </span> is having\r\n            <span class=\"detailtitlered\">the companions</span> who share the vision with founders and form a dedicated team.\r\n        </div>\r\n    </div>\r\n\r\n    <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n        How do you <span class=\"redcontent\"> view the F&B market</span>? What is the <span class=\"redcontent\">development plan</span> for AirKitchen in <span class=\"redcontent\">3-5 years</span> to come?\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        The two following trends will emerge in the F&B market in the coming time. First, small restaurants will gradually shift to selling online. They will move to alleys, only reserving enough space for shippers to wait for ordered food. The restaurants at prime locations will optimize their seating layout and pay more attention to surrounding scenery and food dcor in a more delicate, exquisite, and classy manner. They will be venues for important meetings or destinations for those who want to taste fine dining menu. The food delivery market will flourish much more brilliantly than now. \r\n        </br></br>\r\n        Secondly, people tend to have meals at home. Despite their busier schedules, people want to cook by themselves. So, the demand for ready-made ingredients will be on a rise.\r\n        </br></br>\r\n        AirKitchen has a quite simple short-term goal that is to become the fastest growing modern F&B restaurant chain in Vietnam with more than 5000 selling locations nationwide. (Laugh)\r\n       </div>\r\n    </div>\r\n\r\n<div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle3\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/08/IMG_2652-copy-scaled.jpg\" alt=\"\" />\r\n        <p>A shipper taking ordered food at a selling location of AirKitchen.</p>\r\n    </div>\r\n</div>\r\n\r\n    <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n        What are the <span class=\"redcontent\"> two things</span> you wish you knew <span class=\"redcontent\">before starting</span> your own business?\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        I think its quite important to take advantage of every opportunity available to build relationships. Not all of the investors we have a chance to meet will accompany us. Yet, we should stay in touch with them because one day, they will help us, in some way, to our desired destination.\r\n        </br></br>\r\n        Many people think that eating out with potential partners is just a waste of time. In fact, its a powerful way for strong network building. They could bring us many valued talents. Word-of-mouth marketing is by far more powerful than a commercial or any PR effort. When we build our startup from zero, being unknown or having no proof of growth potential, how could we attract talents to come and join?\r\n        </br></br>\r\n        A hero never stands alone. The secret to success is having the companions who share the vision with founders and form a dedicated team. Talent acquisition is in fact a tough issue. Its like cohabitation with someone to see if he/she is an ideal wife/husband before marriage (laugh). Therefore, we must be able to figure out talents and evaluate how they respond when disputes arise. We should spend 3 months testing the suitability of our potential partners before embarking on any project.\r\n        </br></br>\r\n        Such a period of time is fair enough for us to have an overview of their dispute resolution. We appreciate those who enthusiastically defend their opinions while listening to their teammates. More importantly, dont ever let work ruin relationships with your co-workers. At work, you can argue with your teammates to raise and defend your opinions. Yet, after the discussion is over, you and everyone in the team should treat each other as if a family, comfortably enjoying lunch and a few cups of beer at a roadside stall together. A long-term work relationship is built on that foundation.\r\n       </div>\r\n    </div>'),
