(1789, 448, '_content_content_part_1_detail_title', 'field_62c65008d6c86'),
(1790, 448, 'content_content_part_1_detail_content', '<div class=\"detailarticle\">\r\n    Mandu is a social commerce platform that gathers more than 100 prestigious brands such as Phillips, Cuckoo, Hurom, Ultty, etc., and over 1.000 collaborators.\r\n    <br/> <br/>\r\n    According to a report by the Vietnam E-commerce and Digital Economy Agency, the global social commerce market revenue reached 22 billion USD in 2019. The number is expected to grow by more than 200% in the next 5 years, to 67 billion USD by 2023.\r\n    <br/> <br/>\r\n    Today, we had the opportunity to meet Mr. Hoang Tung  CEO of Mandu and Mrs. Dang Thuy Linh - Co-founder of Mandu. They shared with us about their journey of starting Mandu from scratch. Their sharing partially uncovers the ambition young people cherish as well as the path to their dream.\r\n</div>'),
(1791, 448, '_content_content_part_1_detail_content', 'field_62c65031d6c87'),
