(1801, 448, '_content_content_part_2_detail_title', 'field_62c65117d6c8b'),
(1802, 448, 'content_content_part_2_detail_content', '<div class=\"framequestionmain\">\r\n    <div class=\"frametitle\"> \r\n        <div class=\"detailtitle\">\r\n            We gave our startup the name\r\n            <span class=\"detailtitlered\">Mandu</span>\r\n            as a way to\r\n            <span class=\"detailtitlered\">pay tribute</span> to the <span class=\"detailtitlered\">Korean doctors</span>\r\n            <span>we met on the way</span>\r\n        </div>\r\n    </div>\r\n\r\n    <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n        Can you please tell us a little bit about <span class=\"redcontent\">yourself and your project?</span>\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        Mr. Tung: My name is Tung, majoring in finance. After my graduation, I worked for UBS New York. Then, I came back to Vietnam and took a job at the Ministry of Foreign Affairs for around one year. Yet, I decided to quit the job and shifted to open a restaurant named Poke because I prefer doing business. At present, Poke has branches in both Hanoi and Ho Chi Minh city.\r\n         </br></br>\r\n         Ms. Linh: I am Linh  Co-founder of Mandu. I previously studied in France, but not until 2012 did I return to Vietnam. I used to be a lecturer of Business French in the International Faculty (the International Training Institute at present) of Thuongmai University for 4 years before starting up my own business.\r\n         </br></br>\r\n         Mandu is a social commerce platform that brings together many big brands and collaborators. As a complete social commerce ecosystem, Mandu deals with 4 major issues for those who want to sell online, which are: (1) Source of goods; (2) Marketing skills and tools; (3) operation, warehousing, and (4) capital. Sellers only need to focus on taking care of their customers and increasing sales, Mandu will take care of the rest!\r\n    </div>\r\n    </div>\r\n\r\n<div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/Mandu1-2.jpg\" alt=\"\" /> <p> Warehousing and packing area of Mandu. </p>\r\n    </div>\r\n    <div class=\"frameimgarticle2\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/Mandu4-copy.jpg\" alt=\"\" />\r\n    </div>\r\n</div>\r\n\r\n    <div class=\"framequestiontitle2\" >\r\n    <div class=\"questiontitle\">\r\n        <span class=\"redcontent\">Why</span> did you <span class=\"redcontent\">name</span> \r\n        your startup <span class=\"redcontent\">Mandu</span> ?\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        Ms. Linh: We love and take care of Mandu as if it were our 4th biological child. We first came to Korea to find treatment for our eldest and youngest children in July 2019. Our youngest child has the nickname Bnh bao (dumpling). Bnh bao in Korean is mandu. So, we gave our startup the name Mandu as a way to pay tribute to the Korean doctors we met on the way. With this name, we want to spread the message that our sustained efforts will always be rewarded.\r\n    </div>\r\n    </div>\r\n\r\n    <div class=\"framequestiontitle2\" >\r\n    <div class=\"questiontitle\">\r\n        How could you \r\n        <span class=\"redcontent\">come up with</span> the idea of <span class=\"redcontent\">building Mandu</span> ?\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        Ms. Linh: As an experienced online seller, I know the difficulties of online sellers like the back of my hand. Looking for prestigious, quality supply sources is very time-consuming and costly. During our stay in Korea, we got to know an interesting distribution model that enables collaborators to connect with brands with zero capital. In so doing, business risks are minimized, and the chances of success increase to a great extent. Back to Vietnam, we decided to embark on deploying a similar model with the aim of helping Vietnamese people, especially women, develop their own online businesses, earn an additional source of income, and enjoy financial independence and stability.\r\n    </div>\r\n    </div>\r\n\r\n    <div class=\"framequestiontitle2\" >\r\n    <div class=\"questiontitle\">\r\n        Did you encounter \r\n        <span class=\"redcontent\">any difficulties </span> in the early days of <span class=\"redcontent\">putting the idea into practice?</span> ?\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        Mr. Tung: Of course, we did. Difficulty after difficulty arose. Personally, I think the biggest challenge to Mandu in particular and any startups in general is how to identify a promising direction to follow. So, learning on the job was our choice. We tested different business models, various market approaches, and customer service techniques. Whenever an idea came up, we made assumptions and checked its feasibility to figure out the fastest and least costly option. Before putting any option into the process, we have to refine it constantly to ensure its the best possible.\r\nFinding a direction when there are resources available is inherently difficult. Whats more difficult is to start a business when there is a shortage of both facilities and employees like what Mandu faced in the past. We started Mandu from an apartment in a residential building, which is quite similar to Alibaba in its early days. Lets hope that Mandu will one day be as successful as Alibaba! (Laugh)\r\n    </div>\r\n    </div>   \r\n\r\n<div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/08/Packaging-area.jpg\" alt=\"\" /> <p> The old office of Mandu. </p>\r\n    </div>\r\n    <div class=\"frameimgarticle2\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/08/Sales-team.jpg\" alt=\"\" />\r\n    </div>\r\n</div>\r\n</div>'),
