(1812, 448, 'content_content_part_3_detail_content', '<div class=\"framequestionmain\">\r\n    <div class=\"frametitle\"> \r\n        <div class=\"detailtitle\">\r\n            <span>On average,</span>\r\n            <span class=\"detailtitlered\">50% of our collaborators</span>\r\n            have orders on a monthly basis,\r\n            <span class=\"detailtitlered\">much higher</span> than that of <span class=\"detailtitlered\"> our competitors.</span>\r\n            \r\n        </div>\r\n    </div>\r\n\r\n    <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n        In your view, what makes <span class=\"redcontent\">Mandu different</span> from its <span class=\"redcontent\">existing competitors</span> in the market?\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        Ms. Linh: Used to be online sellers, we know the difficulties faced by collaborators inside out. With a thorough understanding of their problems, we could offer them the most suitable options in terms of goods supply, warehousing, support, etc. On average, 50% of our collaborators have orders on a monthly basis, much higher than that of our competitors. This is a testament to the efficiency of our approach.\r\n    </div>\r\n    </div>\r\n\r\n<div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/Mandu5-copy.jpg\" alt=\"\" /> <p> A corner at Mandu for its collaborators. </p>\r\n    </div>\r\n    <div class=\"frameimgarticle2\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/08/Mandu6.jpg\" alt=\"\" />\r\n    </div>\r\n</div>\r\n\r\n    <div class=\"framequestiontitle2\" >\r\n    <div class=\"questiontitle\">\r\n         In your opinion, what are\r\n        <span class=\"redcontent\">the differences</span> between <span class=\"redcontent\">traditional business</span> \r\n        and <span class=\"redcontent\">startup</span> ?\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        Mr. Tung: I think the difference lies in the growth speed of the business. Startups may enjoy exponential growth, not just the annual growth of 30-40%. Whats more, startup-ers have more chances to tie up with the investors who share the same vision. They are willing to back startups not only financially but also in terms of strategic consulting, which is vital for startups to leap forward. Mandu is quite lucky in this regard.\r\n    </div>\r\n    </div>\r\n</div>'),
