(1821, 448, '_content_content_part_4_detail_title', 'field_62c653fad6c95'),
(1822, 448, 'content_content_part_4_detail_content', '<div class=\"framequestionmain\">\r\n    <div class=\"frametitle\"> \r\n        <div class=\"detailtitle\">\r\n            Be\r\n            <span class=\"detailtitlered\">humble</span>\r\n            and\r\n            <span class=\"detailtitlered\">mentally strong</span> in face of  <span class=\"detailtitlered\">failures.</span>\r\n            \r\n        </div>\r\n    </div>\r\n\r\n    <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n         What do you think about <span class=\"redcontent\">the social commerce</span> market in <span class=\"redcontent\">3-5 years to come</span> ? What is <span class=\"redcontent\">your plan</span> for Mandu? \r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        Mr. Tung: I think the social commerce market will continue its upward trend. The covid pandemic and the practice of social distancing have led to dramatic changes in consumer behavior. Now, people buy online, including via e-commerce and social commerce, many things that they used to buy offline. What makes social commerce different from e-commerce platforms is that its online interaction experiences are very real, making us feel like going to physical stores. Thats the reason why the social commerce market has reached a size of 14 billion USD, surpassing the size of e-commerce platforms at 8 billion USD. This market will keep thriving in the time to come.\r\nApart from that, the average age of shoppers on social commerce has been increasing. Not only young people but also older persons have been present on social networking platforms.\r\n        </br></br>\r\n        Social commerce has brought about great opportunities to sellers. There are a large number of sellers on social media platforms in Vietnam. If they have companions and supporters who share difficulties with them, they will save much time and effort. Their chance of success, thus, will be higher. We aim to turn Mandu into a hub where everyone could build a thriving online business.\r\n    </div>\r\n    </div>\r\n\r\n    <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n         Could you please share <span class=\"redcontent\">your invaluable startup experience</span> with young people?\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        Mr. Tung: Be humble and be mentally strong in face of failures. Some people just stay within their comfort zone and feel like they master everything in life, whereas in fact, they couldnt apply what theyve learnt to their startup. Whenever you face a problem, even if it is serious or not, dont ever think that you know it all. Remember to raise questions and dig deeper into things that we already know to find the answers. Once you have the answers, be decisive to deploy the solutions with acceptable risks. \r\n        </br></br>\r\n        Next, get ready to fail. Whenever you fall, try to stand up as fast as possible, and remember to bring along the lessons learned for the coming trips. Starting a business is like seeing a baby growing up. The baby learns to walk by learning to fall. Even after knowing how to walk and run, the kid can fall again and again. What matters is how long it takes the baby to stand up again and if he/she does have the courage to move on or not.\r\n    </div>\r\n    </div>\r\n</div>'),
