(1893, 475, 'content_content_part_1_detail_content', '<div class=\"detailarticle\">\r\n   More than 200,000 customers registered in the system, over 2,000,000 tasks completed, customer satisfaction rate up to 97%\r\n    <br/> <br/>\r\n    After just 3 years since its launch, bTaskee brought about a monthly income of around VND 20 million to its collaborators. In 2022, bTaskee have broken its own record when the average monthly income of the bees is up to VND 30 million.\r\n\r\n    <div class=\"framequestionmain\">\r\n    <div class=\"frameimg\">            \r\n            <img src=\"https://contrau.metacoders.dev/wp-content/uploads/2022/07/imagearticlemobile-1.png\" alt=\"\" />            \r\n            <p>Photo: BTaskees CEO  Co-founder and its collaborator</p>        \r\n    </div>\r\n    </div>\r\n\r\n    <div class=\"framequestiontitle\">\r\n    Nathan Do graduated from the University of Waterloo - one of the top Canadian universities for software engineering. After his graduation, he got attractive job offers from many renowned Canadian companies with a salary of up to tens of thousands of Canadian dollars per month. However, he always felt an urge to do something that bears his own imprint, while giving a hand to a better society in his home country, Vietnam.\r\n    <br/> <br/>\r\nHe is well aware that starting a business is a tremendously long journey that startup-ers must set out on with great fortitude. Equipping themselves with sound knowledge and extraordinary single-mindedness is the key for them to travel a long distance and in a sustainable manner.\r\n   <br/> <br/>\r\nToday, ConTrau Ventures had the opportunity to meet and talk with Mr. Do Dac Nhan Tam - Founder of the house cleaning service application bTaskee. He sat down to share with us about his startup story and revealed the mission hed like to fulfill by developing the house cleaning service application bTaskee.\r\n     </div>\r\n</div>'),
