(1899, 475, 'content_content_part_1_detail_content_image', '<div class=\"frameimg\">             <img src=\"https://contrau.metacoders.dev/wp-content/uploads/2022/07/z3408112350393_7d7c44e7cbd95abaceb7a8bab35588b3-scaled.jpg\" alt=\"\" />             <p>Photo: Photo: CEO - Founder of bTaskee Do Dac Nhan Tam.</p>         </div>'),
