(1905, 475, 'content_content_part_2_detail_content', '<div class=\"framequestionmain\">     \r\n    <div class=\"frametitle\">      \r\n        <div class=\"detailtitle\">      \r\n            <span class = \"detailtitlered\"> The biggest difficult </span> \r\n            is how to&nbsp; <span class = \"detailtitlered\">keep the belief</span>\r\n            &nbsp;in my collaborators. \r\n            <span> If I don\'t trust them, who will? </span> \r\n        </div> \r\n    </div> \r\n    \r\n    <div class=\"framequestiontitle\"> \r\n    <div class=\"questiontitle\"> \r\n    <span class=\"redcontent\"> Why did you come up with </span>\r\n    &nbsp;the idea of building the house cleaning service application bTaskee? \r\n    </div>     \r\n    <div class=\"articlequestion\">To be honest, before bTaskee, I once challenged myself with another startup but it went nowhere. Then, I came to realize that Vietnam has great economic potential, yet a big gap between the rich and the poor remains in the country. Many apps and services are made or planned to be made for well-off persons. What about those who have to work hard day in and day out to earn every penny? They dont have the right to choose what to do. Many people, especially single moms, are unable to cover the cost of their childrens tuition fees. I want to show them how precious and potential their work is. Thats the motivation for me to deploy the idea of building the house cleaning service application bTaskee.\r\n    </div> \r\n    </div>\r\n    \r\n    <div class = \"framequestiontitle2\"> \r\n        <div class = \"questiontitle\"> \r\n            You said that your first startup failed. \r\n            <span class =\"redcontent\"> What lessons </span> \r\n            have you learn \r\n           <span class =\"redcontent\"> from that failure </span> \r\n        </div> \r\n\r\n        <div class = \"articlequestion\"> \r\n            <p> In 2006, I started a business involving SaaS (Software-as-a-Service) and cloud computing products to help businesses manage their data in a more secure and cost-efficient way. However, back then, most of small- and medium-sized enterprises were yet to be ready to employ SaaS. This is understandable because it always takes much time and resources to change consumers mindset. However, after the first failure, I had more time to look back at my past journey and realized that doing something brand new isnt always a wise choice. There are lingering social problems waiting for us to tackle and technological application can work miracles in this regard. \r\n            </p>\r\n        </div> \r\n    </div> \r\n\r\n    <div class=\"frameimgarticle\">\r\n      <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.metacoders.dev/wp-content/uploads/2022/07/DSC03131-copy-scaled.jpg\" alt=\"\" />\r\n        <p>Photo: A collaborator of bTaskee</p>\r\n      </div>\r\n      <div class=\"frameimgarticle2\">\r\n        <img src=\"https://contrau.metacoders.dev/wp-content/uploads/2022/07/sg-tech-starup-fest-7-copy-1.jpg\" alt=\"\" />\r\n        <p>Photo: bTaskee took part on Saigon Tech Startup Fest in 2016</p>\r\n     </div>\r\n   </div>\r\n\r\n   <div class = \"framequestiontitle2\"> \r\n        <div class = \"questiontitle\"> \r\n            What are \r\n            <span class =\"redcontent\"> the biggest difficulties youve faced </span> \r\n            so far on your startup journey?\r\n        </div> \r\n\r\n        <div class = \"articlequestion\"> \r\n            I think it\'s the belief. The first to mention is having confidence in the startup objectives. When I was just back to Vietnam, I did share with my secondary and high school buddies about my startup intention. They all found the idea quite interesting and novel, but none encouraged me to go on (laughing). They said it was impossible to change the deep-rooted thoughts and behaviors of employees. Asking peoples opinions is just a way for me to have different perspectives on some issue. As a single-minded person, I havent been concerned too much about their words and restlessly pursued my chosen path until I could make it.\r\n         <br/> <br/>\r\n            The second to mention is how to keep the belief in my collaborators. If I don\'t trust them, who will? Once I make them feel respected and trusted in any circumstances, I believe they will trust me back and work with dedication.\r\n        </div> \r\n    </div> \r\n</div> \r\n\r\n'),
