(1915, 475, 'content_content_part_3_detail_content', '<div class=\"framequestionmain\">\r\n    <div class=\"frametitle\">\r\n        <div class=\"detailtitle\">\r\n            BTaskee is\r\n            <span class=\"detailtitlered\">the first unit in Viet Nam</span>to issue housekeeping certificates\r\n            <span>to the qualified taskees with good capacity and attitudes.</span> \r\n        </div>\r\n    </div>\r\n\r\n <div class=\"framequestiontitle\"> \r\n   <div class=\"questiontitle\">\r\n        What have you\r\n     <span class=\"redcontent\"> gained and lost </span>\r\n    as a startup-er \r\n    </div>     \r\n    <div class=\"articlequestion\">I think what Ive gained is more than what Ive lost. Ive had a passion for software technology since my childhood. And now, I have a chance to indulge that passion. More importantly, with bTaskee, I can do something for the society, specifically providing better income to many people and changing their view towards the house cleaning occupation.\r\n       <br/><br/>\r\n          Many bees no longer consider house cleaning as a last resort when they have no other choice. They want to seriously pursue this occupation for a long term and take pride in doing it.\r\n       <br/><br/>\r\n          Whats more, its great to build a team of like-minded people. They share with me the mindset of doing business to improve peoples lives, not just for profit or revenue. I always seek the comfort in my soul and attach greater importance to peace at mind than to the money earned.\r\n       <br/><br/>\r\n          As a matter of course, every decision is a trade-off. When I was just back to Vietnam to live, I was quite vague about my days ahead. Leaving behind my usual habits and good job opportunities in Canada, I stepped out my comfort zone and returned to Vietnam. If I could travel back to 6 years ago, I would still choose to become a startup-er because I know what I need.\r\n  </div> \r\n </div>\r\n    \r\n    <div class = \"framequestiontitle2\"> \r\n        <div class = \"questiontitle\"> \r\n            What makes \r\n            <span class =\"redcontent\"> bTaskee different? </span> \r\n          \r\n        </div> \r\n\r\n        <div class = \"articlequestion\"> \r\n            First to mention is the true value bTaskee brings to our customers and collaborators. About 70% of the current bTaskee users were introduced by their acquaintances to this application. The word-of-mouth effect has partly proved customers recognition of the application. Its also the most powerful PR means that has helped accelerate our growth over the time. bTaskee not only offers collaborators a stable job with highest possible income and working time flexibility but also forms a supportive community where the collaborators have chances to raise their voice and be listened to. Many features on the app have been developed based on such mutual understanding and sharing sessions.\r\n        </div>\r\n    </div>\r\n\r\n        <div class=\"frameimgarticle\">\r\n          <div class=\"frameimgarticle3\">\r\n              <img src=\"https://contrau.metacoders.dev/wp-content/uploads/2022/07/IMG_1305-copy-scaled.jpg\" alt=\"\" />\r\n              <p>Photo:  Bees took part in a Gala of bTaskee</p>\r\n         </div>\r\n       </div>\r\n\r\n   <div class=\"framequestiontitle\">     \r\n        <div class = \"articlequestion\"> \r\n          BTaskee is built on the foundation of sincerity. This is the second thing that differentiates this application from many other similar apps out there. bTaskee doesnt seek profits at all costs. Service quality, customer experience, and collaborators\' earnings are the top values bTaskee has been pursuing so far.\r\n       <br/><br/>\r\n          The service fees and collaborators earnings are all recorded in a detailed, transparent manner. Every feedback on the app, either from customers or collaborators, is responded in a practical way. For example, the training programs, from basic to advanced level, are all digitalized to make sure the collaborators can learn right on the app. bTaskee offers many free courses, too. This is also the first company to issue house cleaning certificates to participants. Apart from that, the company presents monthly awards, the titles of Diamond Bee, Golden Bee, Silver Bee, Top 100 of the year, and organizes year-end gala in recognition of the achievements and efforts of well-performed eTaskee bees. In this way, the company has given people a better insight into the housekeeping occupation.\r\n        </div> \r\n    </div> \r\n</div>'),
(1916, 475, '_content_content_part_3_detail_content', 'field_62c653b4d6c91'),
