(1924, 475, '_content_content_part_4_detail_title', 'field_62c653fad6c95'),
(1925, 475, 'content_content_part_4_detail_content', '<div class=\"framequestionmain\">\r\n    <div class=\"frametitle\">\r\n        <div class=\"detailtitle\">\r\n            <span class=\"detailtitlered\">The winner</span> is\r\n            <span class=\"detailtitlered\">not the best,</span> but the one who\r\n            <span class=\"detailtitlered\">does not give up</span>\r\n            <span>on the way to the finish line.</span> \r\n        </div>\r\n    </div>\r\n\r\n <div class=\"framequestiontitle\"> \r\n   <div class=\"questiontitle\">\r\n        What about\r\n     <span class=\"redcontent\">the future plan </span>\r\n    of BTaskee\r\n    </div>     \r\n    <div class=\"articlequestion\">BTaskee aims to keep its growth momentum and secure No.1 position in the heart of customers in Vietnamese market. We plan to offer some new, highly requested services such as Elderly Care and Babysitting. bTaskee has put a lot of effort and time into these features, so I believe our customers will be completely pleased with them.\r\n       <br/><br/>\r\n          BTaskee has been present in Thailand for over 3 months now. Based on the initial growth data and market feedback, we set the objective of taking the lead in this market by the end of 2022 or by the end of Q1/2023 at the latest. \r\n       <br/><br/>\r\n          As planned, bTaskee will be available in 6 major countries of the Southeast Asia by the end of 2024. We have been in desperate search of youthful, dedicated companions on the path of conquering the Southeast Asia.\r\n  </div> \r\n </div>\r\n    \r\n    <div class = \"framequestiontitle2\"> \r\n        <div class = \"questiontitle\"> \r\n            Do you have \r\n            <span class =\"redcontent\"> any service </span> to the young people\r\n            <span class =\"redcontent\"> nurturing startup ideas? </span>\r\n        </div> \r\n\r\n        <div class = \"articlequestion\"> \r\n           Don\'t set too ambitious goals! Dare to trade off, dare to cope with any challenges lying ahead. Your startup might go nowhere, but thats fine. Its because in return, you will reap precious lessons for your upcoming journey. When a door is closed, another door  perhaps brighter and broader - will open for a more mature version of you.\r\n       <br/><br/>\r\n          Second, be wise to set the objectives to strive for. Revenue is the final result but it isnt the measure of the overall success. Instead, we should look at the real values and contributions that a project/product brings to its customers and the society. Once having proper objectives to strive for, we will reap success sooner or later.\r\n       <br/><br/>\r\n          Reality might go far different from imagination. So, each person needs to build and strengthen their resilience and mental toughness. Some just go halfway and then come back. Then, how could they know what is waiting for them at the end of the journey? Its always true that the winner is not the best, but the one who doesn\'t give up on the way to the finish line.\r\n        </div> \r\n    </div> \r\n</div>'),
