(2479, 647, 'content_content_part_1_detail_content', '<div class=\"detailarticle\">\r\n   Papaya is a platform that incorporates technologies into the traditional insurance industry to bring about modern, user-friendly experiences and earn the trust of its users.\r\n</div>\r\n'),
