(2485, 647, 'content_content_part_1_detail_content_image', '<div class=\"frameimg\">                     <img src=\"https://contrau.metacoders.dev/wp-content/uploads/2022/07/papayafounder-scaled.jpg\" alt=\"\" />                     <p>CEO Phan Duc Hung - Founder of Papaya</p>             </div>'),
