(2490, 647, '_content_content_part_2_detail_title', 'field_62c65117d6c8b'),
(2491, 647, 'content_content_part_2_detail_content', '<div class=\"framequestionmain\">\r\n    <div class=\"frametitle\"> \r\n        <div class=\"detailtitle\">\r\n            <span class=\"detailtitlered\">Buying easily</span>\r\n             but<span class=\"detailtitlered\">claiming money back</span>\r\n            more like<span class=\"detailtitlered\">building a castle in the sky.</span>\r\n        </div>\r\n    </div>\r\n      \r\n  <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n        From <span class=\"redcontent\">overpromise - underdelivery</span> to <span class=\"redcontent\">the commitment</span> to cover future risks.\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n       In the 2000s, when it came to insurance, everyone had the following perception: buying easily but claiming money back more like building a castle in the sky. Generally speaking, many people thought insurance was nothing more than a form of scam.\r\n\r\n        <br/><br/>\r\n        Over more than two decades, mainstream insurance companies have become more selective in terms of recruiting agencies and applied severe penalties to their violations. Thanks to their ongoing efforts, Vietnamese people have become more open to this industry. Yet, the prejudice over this industry has taken roots too deeply to remove overnight. It takes much time for this industry to win peoples trust completely. This bottleneck is the rationale behind the birth of a startup that combines technologies and insurance. It promises to give users a different perspective on this industry as well as bring about a more meaningful, fulfilling life for everyone.\r\n\r\n        <br/><br/>\r\n       Papaya - a digital insurance platform  came to life with the mission of employing technologies to popularize insurance information among Vietnamese people. \r\n     </div>\r\n   </div>\r\n\r\n<div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.metacoders.dev/wp-content/uploads/2022/07/IMG_1935.jpeg\" alt=\"\" />\r\n    </div>\r\n    <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.metacoders.dev/wp-content/uploads/2022/07/IMG_1933.jpeg\" alt=\"\" />\r\n        <p> Papaya application interface.</p>\r\n    </div>\r\n    <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.metacoders.dev/wp-content/uploads/2022/07/IMG_1934.jpeg\" alt=\"\" />\r\n   </div>\r\n </div>\r\n\r\n <div class=\"framequestiontitle\">\r\n   <div class=\"articlequestion\">       \r\nWith Papaya, you will neither have to receive ringing phone calls from insurance staff nor hear such false promises as buy it and get compensated at any cost.\r\nInstead, with just a touch or a click, all necessary information about any insurance packages, the rights, and obligations of customers and insurance companies, will be shown before your eyes. This enables clients to research insurance terms and conditions thoroughly before making the final decision.\r\n    </div>\r\n  </div>\r\n\r\n  <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n         <span class=\"redcontent\">Never thought</span>\r\n        of starting a business <span class=\"redcontent\">in the insurance industry.</span>\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n         In 2017, he happened to work for a foreign insurance company in Vietnam. Probably, it was during this time that he nurtured the idea of developing a platform like Papaya, despite everyones negative view of insurance services.\r\n        <br/><br/>\r\n        His determination was strengthened when he came to a small province to open a new branch after just 6 months of joining the company. There he got to know how great insurance was to help local people overcome financial difficulties. When they had an accident or their family members got a serious illness, insurance companies helped cover the treatment expenses, thus they no longer had to get bank loans. Such stories inspired him to do something so that people would have a better understanding of the insurance industry and have a chance to experience these products. His top priority is to ensure that the clients will get paid satisfactorily by insurance companies when they claim insurance money. Thats the only way for people to get real benefits from insurance products, thereby having a more positive view of the countrys insurance industry. \r\n        <br/><br/>\r\n        The startups name Papaya reflects the ambition of the founder. Papaya is the symbolic fruit of the tropics, closely attached to the image of the farmers in Vietnam in particular and in Southeast Asia in general. The fruit is much liked across Vietnam and other Southeast Asian countries. \r\n      </div>\r\n  </div>\r\n\r\n   <div class=\"frameimgarticle\">\r\n      <div class=\"frameimgarticle3\">\r\n        <img src=\"https://contrau.metacoders.dev/wp-content/uploads/2022/07/Training-PPYpro2.jpg\" alt=\"\" />\r\n        <p>Papaya member is introducing application to customers.</p>\r\n      </div>\r\n   </div>\r\n\r\n</div>'),
