(2501, 647, 'content_content_part_3_detail_content', '<div class=\"framequestionmain\">\r\n    <div class=\"frametitle\"> \r\n      <div class=\"detailtitle\">\r\n        <span> I expressed the idea of establishing a startup on </span>\r\n        <span class=\"detailtitlered\">insurance compensation</span>\r\n        ,but\r\n        <span class=\"detailtitlered\">no one</span> thought <span class=\"detailtitlered\">I could</span> do it.\r\n       </div>\r\n    </div>\r\n\r\n  <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n        The very <span class=\"redcontent\">first steps</span> strewn with <span class=\"redcontent\">challenges.</span>\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n       On a warm day in April 2019, Papaya took its very first steps with the provision of motorcycle insurance service to 100 customers, then came the phase of testing different models. Not until May 2020 was the claim settlement service chosen as the trump card of this startup.\r\n        <br/><br/>\r\nFounder of Papaya shared: I expressed the idea of establishing a startup on insurance compensation, but no one thought I could do it. There wasnt any investment fund backing me on this tremendous path. Plus, very few insurtechs (digital platforms that combine insurance and technology) could do it.\r\n        <br/><br/>\r\nRaising capital is an inherent challenge to any startup. Whats more difficult is how to convince people amidst a lot of doubts about and prejudice against the insurance industry. Loaded-up difficulties couldnt discourage him. He has proved that perseverance is the best path to success. \r\n        <br/><br/>\r\nInstead of following emerging trends, Papaya has attached to its core values. Papaya Care was officially launched in September 2020 with about 50,000 users. Most of its users are surprised at and satisfied with its convenience and fast processing speed, from only 15 minutes to 24 hours at maximum.\r\n     </div>\r\n  </div>\r\n\r\n  <div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle3\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/Workshop.jpg\" alt=\"\" />\r\n        <p>A sharing workshop at Papaya.</p>\r\n    </div>\r\n  </div>\r\n\r\n  <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n        Insurtech is like <span class=\"redcontent\">an untapped treasure</span> that <span class=\"redcontent\">hides millions of ideas and opportunities </span> for startups.\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n       Seeing the untapped potential of this market, many companies have come to exploit it. Yet, with the business psychology of doing business, not just for sales, Papaya believes that it can secure a foothold in this market no matter what. The biggest concern of Papaya\'s founder is how the clients can take advantage of insurance products when they need them most. Thats why Papaya has focused its efforts on developing compensation plans. This is a practical action for this platform to deliver its promise of covering future risks while developing accompanying support services.\r\n        <br/><br/>\r\n         Papaya is the main partner of 10 big companies in the insurance industry, including FWD, Bao Minh, PTI, PVI, PJICO, BSH, etc. Each month, this startup receives and processes an average of 5,000 dossiers through the platform of more than 200,000 users and nearly 1,000 distribution agents across Vietnam. Papayas service packages vary, from motorcycle, auto, and health insurance to personalized insurance services.\r\n</div>\r\n</div>\r\n\r\n  <div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle3\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/1646627786057.jpeg\" alt=\"\" />\r\n        <p>Signing ceremony between Papaya and AAA insurance company.</p>\r\n    </div>\r\n  </div>\r\n</div>'),
