(2511, 647, 'content_content_part_4_detail_content', '<div class=\"framequestionmain\">\r\n    <div class=\"frametitle\"> \r\n      <div class=\"detailtitle\">\r\n        \"If you want to \r\n        <span class=\"detailtitlered\">go fast, go alone</span> ,but if you want to\r\n        <span class=\"detailtitlered\">go far, go together.</span>\"\r\n       </div>\r\n    </div>\r\n\r\n  <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n       <span class=\"redcontent\">The opportunity cost </span> of a<span class=\"redcontent\"> four-year</span> startup journey.\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n       To Mr. Hung, four years of starting a business are neither too long nor too short. Time, money, and energy are the inevitable trade-offs that he is willing to spend. Wage-earners have abundant time for their friends and family; whereas, startup-ers like Hung are always in shortage of time. Yet, Hung day in and day out reminds himself of persistently pursuing his chosen path. Actions speak louder than words. All he has been doing so far is to prove that he can do what he said. He owes a promise to those who have trusted and accompanied him on this rough route, and he has been tirelessly striving to fulfill it.\r\n     </div>\r\n    </div>\r\n\r\n  <div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/Christmas-2021.jpg\" alt=\"\" /> <p> Christmas event with Papaya whole team.</p>\r\n    </div>\r\n    <div class=\"frameimgarticle2\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/Outdoor-activities.jpg\" alt=\"\" /> <p>Papaya team building activities.</p>\r\n    </div>\r\n  </div>\r\n\r\n  <div class=\"framequestiontitle\">\r\n    <div class=\"articlequestion\">\r\n       There is a saying that goes: If you want to go fast, go alone, but if you want to go far, go together.\r\nBeing accompanied by more than 30 talented, dedicated co-workers at Papaya is what Hung feels lucky and most proud of. He respects and treasures every individual in his company. Without anyone of them, Papaya would havent come to life and earned ever-growing success as it is now.\r\n     </div>        \r\n   </div>\r\n</div>'),
