(3933, 732, 'content_content_part_1_detail_content', '<div class=\"detailarticle\">\r\nDo you know how much CO2 is emitted by gas motorbikes into the environment each passing day?\r\nAccording to a study by Australian scientists, on average, a gas motorbike produces 588 grams of direct and indirect CO2 emissions per kilometer. Whereas, CO2 emissions per kilogram by electric motorbikes are around 213 grams, some 40% fewer.\r\n\r\n</br></br>\r\nVietnam is known as the world\'s second largest motorcycle market (just after Indonesia, the most populous country in Southeast Asia) with more than 50 million vehicles sold (data from the National Traffic Safety Committee). Each year, the motorbikes in circulation in Vietnam consume about 5 billion USD of gasoline and produce some 63% of the total amount of air pollution in our country.\r\n</br></br>\r\nA smart electric motorbike startup has been established recently to address the above-mentioned persistent problem with a view toward green transportation for Vietnamese people.\r\n</br></br>\r\nIt was an afternoon with well-scattered patches of light rain in Saigon. Sitting in front of us was Mr. Nguyen Huu Phuoc Nguyen - Co-founder of electric motorcycle startup Selex Motors. He just came over after visiting his vehicle manufacturing factory. We had talked for forty minutes only, but that was long enough for me to have a better understanding of the opportunities and challenges facing Selex Motors  on its chosen path.\r\n</br></br></br>\r\n</div>'),
