(3945, 732, 'content_content_part_2_detail_content', '<div class=\"framequestionmain\">\r\n    <div class=\"frametitle\"> \r\n        <div class=\"detailtitle\">\r\n            \" As for electric motorbike products,\r\n            <span class=\"detailtitlered\"> its not strange at all</span>\r\n            if the producer\r\n            <span class=\"detailtitlered\">doesnt have any customers after three years\".</span>\r\n        </div>\r\n    </div>\r\n\r\n    <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n        The <span class=\"redcontent\">cost of starting</span> a business\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        Lets travel back in time to 4 years ago. In January 2018, an electric motorcycle startup was officially launched in Vietnam.\r\n        <br/><br/>\r\n        The very first steps are always the most unforgettable memories for any startup founder. Nguyen recalled the days he and his seven co-workers were up to their eyes in doing research, testing batteries, and designing every part of an electric vehicle, from the smallest, in a 10m2 abandoned office on the campus of Hanoi University of Science and Technology. \r\n       <br/><br/>\r\n        He sincerely shared: Among many times of testing the product, the office almost caught fire once. It was when we tried out the batteries. Normally, there must be someone supervising the whole process. However, that day, the observer fell asleep and the batteries inflamed at around 02:00 a.m. The fire then quickly spread to a corner of the room. Fortunately, he could wake up in time. If he were just one minute late, I dont know how things would have turned out (laughs). Now, when looking back at the past journey, I think our team has earned valuable lessons to offer the safest possible products to our customers.\r\n       <br/><br/>\r\n        The startup journey is strewn with hurdles; it isnt easy at all. Apart from the shortage of resources and capital from the early days, market-related issues cost the Selex team much time and effort. To realize the set goals, they must stay diligent and painstaking all the times. In fact, the concept of electric motorbike is yet to have been widely known in Vietnam, so it takes more time for this market to bloom. Mr. Nguyen honestly admitted: It may take an application only 3 months to win customers heart. As for electric motorbike products, its not strange at all if the producer doesnt have any customers after three years of countless efforts.\r\n       <br/><br/>\r\n        And in October 2018, the first model was launched in reward for the unremitting efforts of the entire Selex team.\r\n    </div>\r\n    </div>\r\n\r\n<div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle3\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/WhatsApp-Image-2022-06-09-at-11.58.59-AM-copy.jpg\" alt=\"\" />\r\n        <p>Selexs first motorbike model for B2C segment</p>\r\n    </div>\r\n</div>\r\n</div>\r\n'),
