(3955, 732, 'content_content_part_3_detail_content', '<div class=\"framequestionmain\">\r\n    <div class=\"frametitle\"> \r\n        <div class=\"detailtitle\">\r\n             The team decided to shift their target segment\r\n            <span class=\"detailtitlered\">from B2C to B2B </span>\r\n             for the e-commerce logistics market.\r\n        </div>\r\n    </div>\r\n\r\n  <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n        <span class=\"redcontent\">Problem</span> gives birth to <span class=\"redcontent\">wisdom</span>\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        The Covid-19 pandemic outbreak in 2020 created chaos to every normal norm. Despite their efforts, Selex team failed to deploy their product development plan on schedule. This was thought to set the whole team back. Yet, it was a test of the teams vision and agility. The team decided to shift their target segment from B2C (Business to Customer) to B2B (Business to Business) for the e-commerce logistics market. This is one of the very few areas that could survive amid the overall frozen economic landscape. Selexs electric motorcycle models dedicated to logistics came to life that way.\r\n    </div>\r\n   </div>\r\n\r\n<div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle3\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/DSCF5135-copy-scaled.jpg\" alt=\"\" />\r\n        <p>Selexs cargo motorbike model for B2B segment in 2021.</p>\r\n    </div>\r\n</div>\r\n\r\n  <div class=\"framequestiontitle\">\r\n    <div class=\"articlequestion\">\r\n        In September 2021, the cargo motorbike model was completed by the enthusiastic Selex team. Its container is designed in the way of increasing the freight capacity by 50% and saving fuel costs by 30% as compared to the traditional gas motorbikes. Especially, the model goes with a convenient battery change solution. Instead of having to wait for hours to charge the motorbike battery, Selexs customers just need to replace the depleted battery with the charged one. This process takes some 2 minutes only and is considered the key advantage of Selex Motors. Apart from that, this electric motorbike model is suitable for use with other purposes: carrying passengers or using in daily life.\r\n       </br></br>\r\n       Though Selex electric cargo motorbikes are yet to be officially open for sale, they have been warmly welcomed by many reputable partners. Selex Motors has signed contracts with major partners such as Lazada Logistics, Viettel Post, etc. to offer the product within this year.\r\n       </br></br>\r\n       What makes Nguyen, the founder of Selex Motors, proudest in the past four years isnt the huge number of orders or partners coming to his startup company, but the dedicated people who have accompanied him in building a startup with its own vision, mission, and culture. Mr. Nguyen said: Selex is like a baby whose independence grows over time. It will develop further and bring about more values to society. Thanks to everyone\'s contributions, here I can declare with confidence that we will move forwards to realize our set goals, no matter how much time and effort it takes.\r\n     </div>\r\n  </div>\r\n\r\n<div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle3\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/opt_DSCF5310-copy.jpeg\" alt=\"\" />\r\n        <p>Selex Motors team.</p>\r\n    </div>\r\n</div>\r\n\r\n  <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n        <span class=\"redcontent\">Green transportation</span> and <span class=\"redcontent\">the solution</span> to environmental pollution in Vietnam.\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        Smoke, dust, noise pollution, people waiting in long queues for fuel in a context of escalating fuel prices, and a series of other issues related to the Vietnamese peoples habit of using gas motorbikes are prolonged problems to deal with. Among others, electric vehicles are an invention that somewhat helps tackle the above-mentioned concerns, specifically by minimizing the amount of CO2 emitted into the environment, contributing to freshening the air and improving peoples health and living conditions.\r\n        <br></br>\r\n         The features of a smartphone are integrated into Selex motorbikes, which adds values to these products. Specifically, the cargo motorbikes under the Selex Motors brand can locate locations, track maps, contact the repair team in cases of emergency, etc. A host of new gadgets is being tested and researched by the team.\r\n        <br></br>\r\n         Selex Motors aims to develop more advanced, convenient features for its existing products with the ultimate goal of becoming the leading supplier of electric cargo motorbikes in Vietnam.\r\n      </div>\r\n    </div>\r\n\r\n   <div class=\"frameimgarticle\">\r\n      <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/DSCF5220-copy-scaled.jpg\" alt=\"\" />\r\n      </div>\r\n      <div class=\"frameimgarticle2\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/IMG_2739-copy-scaled.jpg\" alt=\"\" />\r\n      </div>\r\n  </div>\r\n\r\n   <div class=\"frameimgarticle\">\r\n      <div class=\"frameimgarticle1\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/IMG_2769-copy.jpg\" alt=\"\" />\r\n      </div>\r\n      <div class=\"frameimgarticle2\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/IMG_2774-copy-scaled.jpg\" alt=\"\" />\r\n      </div>\r\n  </div>\r\n\r\n<div class=\"frameimgarticle\">\r\n    <div class=\"frameimgarticle3\">\r\n        <img src=\"https://contrau.ventures/wp-content/uploads/2022/07/z3470697020824_30f2dde6e1987fc195eb2529acb1d213-copy.jpg\" alt=\"\" />\r\n        <p>Research and Development procedure of Selex team.</p>\r\n    </div>\r\n</div>\r\n\r\n</div'),
