(3964, 732, '_content_content_part_4_detail_title', 'field_62c653fad6c95'),
(3965, 732, 'content_content_part_4_detail_content', '<div class=\"framequestionmain\">\r\n    <div class=\"frametitle\"> \r\n        <div class=\"detailtitle\">\r\n            <span> \"Before you embark on any startup project,</span>\r\n             think about whether you are\r\n            <span class=\"detailtitlered\">willing to devote your next 5 years, 10 years </span>\r\n            or even longer to it.\"\r\n        </div>\r\n    </div>\r\n\r\n  <div class=\"framequestiontitle\">\r\n    <div class=\"questiontitle\">\r\n        <span class=\"redcontent\">Slow down</span> to <span class=\"redcontent\">speed up.</span>\r\n    </div>\r\n    <div class=\"articlequestion\">\r\n        Rory Vaden - Author of the book Take the Stairs: 7 Steps for Achieving True Success has the renowned saying that goes: Success is not owned, it is rented - and that rent is due every day. Its so true. When asked about the fruits of his past four-year journey, Nguyen said: Its great to have a dream and ambition to pursue it, but first, you need to look at the reality. Before you embark on any startup project, think about whether you are willing to devote your next 5 years, 10 years, or even longer to it because it will seize almost 90% of your time and dedication.\r\n       </br></br>\r\n        How could we see crystal clear, tranquil water when there are ripples on the lake surface? The same goes for the startup journey. The startup ship sometimes has to speed up to pursue the opportunity ahead. Yet, sometimes it should slow down and take a look back on the past cruise. Its the precious time for the captain and the whole crew to realize its core values, or in other words, the reasons for it to be chosen by customers among various competitive options out there. Slowing down to review the past journey and make suitable adjustments is worthwhile, too. \r\n       </br></br>\r\n        Sharing our ideas with others to get their helpful, honest feedback is something we have to learn seriously and do regularly. Some startup founders are opinionated, say firmly adhering to their own opinion. However, by sharing ideas and getting peoples feedback, even criticism, we will have different perspectives and finally can figure out the best. Thats also a great way to attract like-minded talents on this arduous start-up journey.\r\n     </div>\r\n    </div>\r\n</div>'),
